// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Admin.sol";
import "./Utils.sol";

contract Airline {
    Admin public admin;
    mapping(address => bool) public isAirline;

    event AirlineRegistered(address indexed airline);
    event OrderPlaced(uint indexed orderId, address indexed airline, address supplier, uint quantity);

    modifier onlyAdmin() {
        require(admin.isAdmin(msg.sender), "Only admin can call this function");
        _;
    }

    modifier onlyAirline() {
        require(isAirline[msg.sender], "Only registered airlines can call this function");
        _;
    }

    constructor(address _admin) {
        require(_admin != address(0), "Admin address cannot be zero");
        admin = Admin(_admin);
    }

    function registerAirline(address _airline) external onlyAdmin {
        require(_airline != address(0), "Airline address cannot be zero");
        require(!isAirline[_airline], "Airline already registered");
        isAirline[_airline] = true;
        emit AirlineRegistered(_airline);
    }

    function addFleet(string memory _aircraftId, string memory _model) external onlyAirline {
        admin.addFleet(_aircraftId, _model);
    }

    function placeOrder(address _supplier, string memory _materialId, uint _quantity) external onlyAirline {
        admin.createOrder(_materialId, _quantity, _supplier, msg.sender);
        emit OrderPlaced(admin.orderCount() - 1, msg.sender, _supplier, _quantity);
    }

    function getFleets() external view returns (Utils.Fleet[] memory) {
        return admin.getFleets();
    }

    function getParts() external view returns (Utils.Part[] memory) {
        return admin.getParts();
    }

    function getDeliveries() external view returns (Utils.Delivery[] memory) {
        return admin.getDeliveries();
    }
}
